insert into poi ( name, description, location, image) values (" Akita Kant�?	The Akita Kant� (秋田の竿灯) is a Japanese festival celebrated from 3��? August in Akita City, Akita Prefecture in hope for a good harvest. Around two hundred bamboo poles five to twelve metres long, bearing twenty-four or forty-six lanterns, topped with gohei, and weighing up to fifty kilograms, are carried through the streets by night on the palms, foreheads, shoulders, or lower backs of the celebrants. The festival is first referred to in a[who?] travel diary of 1789 The Road Where the Snow Falls (雪の降る��?. It is one of the main festivals in Tōhoku, along with the Tanabata festival in Sendai, the Aomori Nebuta Matsuri festival, and the Hanagasa Matsuri festival in Yamagata. The Akita Kant� festival was designated an Important Intangible Folk Cultural Property in 1980."", "Akita Kant�?	The Akita Kant� (秋田の竿灯) is a Japanese festival celebrated from 3��? August in Akita City, Akita Prefecture in hope for a good harvest. Around two hundred bamboo poles five to twelve metres long, bearing twenty-four or forty-six lanterns, topped with gohei, and weighing up to fifty kilograms, are carried through the streets by night on the palms, foreheads, shoulders, or lower backs of the celebrants. The festival is first referred to in a[who?] travel diary of 1789 The Road Where the Snow Falls (雪の降る��?. It is one of the main festivals in Tōhoku, along with the Tanabata festival in Sendai, the Aomori Nebuta Matsuri festival, and the Hanagasa Matsuri festival in Yamagata. The Akita Kant� festival was designated an Important Intangible Folk Cultural Property in 1980."", GeomFromText("POINT(140.113 39.7185)"), "http://commons.wikimedia.org/wiki/Special:FilePath/Akita_Kanto.jpg");
