insert into poi ( name, description, location, image) values (" Kada�?	Kada� ([�?adaɲ]; German: Kaaden), is a city in the Ústí nad Labem Region of the Czech Republic.The city lies on the banks of the river Ohře. Although it is situated in an industrial part of the Czech Republic there is no major industry within the city and people usually work in offices or have to commute. There are two large power plants nearby (Tušimice and Prunéřov). Kada� is a tourist centre with highlights being the Franciscan Monastery and the historical square with late Gothic Town Hall Tower. It is also a town with the narrowest lane in the Czech Republic - Katova ulička with only 66.1 cm."", "Kada�?	Kada� ([�?adaɲ]; German: Kaaden), is a city in the Ústí nad Labem Region of the Czech Republic.The city lies on the banks of the river Ohře. Although it is situated in an industrial part of the Czech Republic there is no major industry within the city and people usually work in offices or have to commute. There are two large power plants nearby (Tušimice and Prunéřov). Kada� is a tourist centre with highlights being the Franciscan Monastery and the historical square with late Gothic Town Hall Tower. It is also a town with the narrowest lane in the Czech Republic - Katova ulička with only 66.1 cm."", GeomFromText("POINT(13.2714 50.3761)"), "http://commons.wikimedia.org/wiki/Special:FilePath/Kaa1.jpg");
