insert into poi ( name, description, location, image) values (" Třebí�?	Třebí� ([�?r̝̊ɛbiːtʃ]; German: Trebitsch) is a town in the Moravian part of the Vysočina Region of the Czech Republic. Třebí� is situated 35 km southeast of Jihlava and 65 km west of Brno on the Jihlava River. Třebí� is from 392 to 503 metres above sea-level. Třebí� has a temperate climate with occasional rains. Average annual temperature is 7.5°C, average temperature in July is 18.5°C and -3.4°C in January. Třebí� is a regional centre with a population of approximately 40,000. In the age of expansion, Třebí� was third most important town in Moravia. The population growth started after World War II. Třebí� is an important regional center today. There are many sights. The Jewish Quarter and St. Procopius Basilica is listed as a UNESCO World Heritage Site."", "Třebí�?	Třebí� ([�?r̝̊ɛbiːtʃ]; German: Trebitsch) is a town in the Moravian part of the Vysočina Region of the Czech Republic. Třebí� is situated 35 km southeast of Jihlava and 65 km west of Brno on the Jihlava River. Třebí� is from 392 to 503 metres above sea-level. Třebí� has a temperate climate with occasional rains. Average annual temperature is 7.5°C, average temperature in July is 18.5°C and -3.4°C in January. Třebí� is a regional centre with a population of approximately 40,000. In the age of expansion, Třebí� was third most important town in Moravia. The population growth started after World War II. Třebí� is an important regional center today. There are many sights. The Jewish Quarter and St. Procopius Basilica is listed as a UNESCO World Heritage Site."", GeomFromText("POINT(15.88 49.2167)"), "http://commons.wikimedia.org/wiki/Special:FilePath/Letecký_pohled_na_centrum_Třebíče_od_severozápadu.jpg");
