insert into poi ( name, description, location, image) values (" Baia de Aram�?	Baia de Aram� is a small Romanian town located in the Wallachian county of Mehedinţi with a population of 5,724. The Brebina River runs through the town. Some Dacian ruins can be found in the town, as well as the 17th century Baia de Aram� Monastery . The name of the town means ""copper mine"", suggesting that Baia de Aram� was once a strong copper mining town. However, over the years, many of the mines in the town have closed, leaving roughly half the town unemployed. Eight villages are administered by the town: Bratilovu, Brebina, Dealu Mare, Mărăşeşti, Negoeşti, Pistriţa, Stăneşti and Titerleşti."", "Baia de Aram�?	Baia de Aram� is a small Romanian town located in the Wallachian county of Mehedinţi with a population of 5,724. The Brebina River runs through the town. Some Dacian ruins can be found in the town, as well as the 17th century Baia de Aram� Monastery . The name of the town means ""copper mine"", suggesting that Baia de Aram� was once a strong copper mining town. However, over the years, many of the mines in the town have closed, leaving roughly half the town unemployed. Eight villages are administered by the town: Bratilovu, Brebina, Dealu Mare, Mărăşeşti, Negoeşti, Pistriţa, Stăneşti and Titerleşti."", GeomFromText("POINT(22.8114 45.0)"), "http://commons.wikimedia.org/wiki/Special:FilePath/ROU_MH_Baia_de_Arama_CoA.png");
